import React from "react";
import {
  MDBPopover,
  MDBPopoverBody,
  MDBPopoverHeader,
  MDBBtn,
  MDBContainer,
} from "mdbreact";
import Button from "react-bootstrap/Button";

const PopoverPage = (props) => {
  return (
    <MDBContainer>
      <div style={{ display: "flex" }} className="m-5 p-5">
        <MDBPopover placement="top" popover clickable id="popper1">
          <MDBBtn>popover on top</MDBBtn>
          <div>
            <MDBPopoverHeader>popover on top</MDBPopoverHeader>
            <MDBPopoverBody>{props.title}</MDBPopoverBody>
            <Button>see Trailer</Button>
          </div>
        </MDBPopover>
      </div>
    </MDBContainer>
  );
};

export default PopoverPage;
